import React from 'react';
import Home from './routes/Home';
import About from './routes/About';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route paht='/' component={Home} />
                <Route path='/about' component={About} />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
